import React from "react";
import "./index.css";
import home from "./routes/home";
import friends from "./routes/friends";
import { Route, Routes } from "react-router-dom"

function App() {
  return (
    <>
    <Routes>
      <Route path="/" element={<Home/>} />
      <Route path="/friends" element={<Friends/>} />
    </Routes>
    </>
  );
}

export default App;
